import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import { Login } from "../Login"

function App() {
  return (
    <BrowserRouter>
      <Route path="/login" render={() => <Login />} />
    </BrowserRouter>
  );
}

export default App;
